import React from 'react';
import './Robots.css'; // Agregaremos estilos personalizados

const Robots = () => {
  // Simulamos los datos de los robots
  const robots = [
    { id: 1, nombre: "Pedrito", modelo: "PR-001", fabricante: "Robotico Corp" },
    { id: 2, nombre: "IronChef", modelo: "IC-3000", fabricante: "RoboCocina Inc." },
    { id: 3, nombre: "Chispite", modelo: "LT-007", fabricante: "SparkBots Ltd" },
    { id: 4, nombre: "SrCalculin", modelo: "MC-808", fabricante: "Mathematrix Solutions" },
    { id: 5, nombre: "DoctoraBot", modelo: "HL-9000", fabricante: "MediTech Industries" },
    { id: 6, nombre: "ZumbaTron", modelo: "ZT-2025", fabricante: "DanceTech Co." },
  ];

  return (
    
    <div className="robots-container">
      <h1>Listado de Robots</h1>
      <table className="robots-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Nombre</th>
            <th>Modelo</th>
            <th>Empresa Fabricante</th>
          </tr>
        </thead>
        <tbody>
          {robots.map((robot) => (
            <tr key={robot.id}>
              <td>{robot.id}</td>
              <td>{robot.nombre}</td>
              <td>{robot.modelo}</td>
              <td>{robot.fabricante}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Robots;
